import React from 'react';
import { Box, Typography, TextField, Button } from '@mui/material';

const Playground = () => {
  return (
    <Box sx={{ p: 3, height: '100vh', backgroundColor: '#0F172A' }}>
      <Typography variant="h4" sx={{ color: '#F8FAFC', mb: 3 }}>
        Playground
      </Typography>
      <Box sx={{ display: 'flex', flexDirection: 'column', gap: 2 }}>
        <TextField
          fullWidth
          multiline
          rows={4}
          placeholder="Ask anything..."
          sx={{
            backgroundColor: '#1E293B',
            '& .MuiOutlinedInput-root': {
              color: '#F8FAFC',
              '& fieldset': {
                borderColor: '#334155',
              },
              '&:hover fieldset': {
                borderColor: '#475569',
              },
              '&.Mui-focused fieldset': {
                borderColor: '#60A5FA',
              },
            },
          }}
        />
        <Button
          variant="contained"
          sx={{
            alignSelf: 'flex-end',
            backgroundColor: '#60A5FA',
            '&:hover': {
              backgroundColor: '#3B82F6',
            },
          }}
        >
          Send
        </Button>
      </Box>
    </Box>
  );
};

export default Playground;
